import { ButtonGroup, Col, Row} from 'react-bootstrap';

import 'bootstrap/dist/css/bootstrap.min.css';
function Person() {
    return (
        <div>
           <Row>
                <Col>1 of 3</Col>
                <Col xs={5}>2 of 3 (wider)</Col>
                <Col>3 of 3</Col>
            </Row>
        </div>
    )
}

export default Person
